import React from 'react';
import '../styling/Navigation.css';

export default function NavigationBar() {

    return(
        <div class="navbar-container">
            <div class="navbar-logo">Idea</div>
            <div class="navbar-links">
                <div>Coding Projects</div>
                <div>Education</div>
                <div>About Me</div>
                <div>Gallery</div>
            </div>
        </div>
    )
}
